- input: "TEXT\x1CC00305920\x1CX0\x1C\x1CF3A\x1CMs. Rebecca Hough, FEC, Washington,
    DC 20463  Dear Ms. Hough:  I am filing an amendment to the April Quarterly because
    the person who puts in the contributions made an error that I just discovered
    when checking another contribution issue in the record.  We received a PAC check
    from the National Education Association and the check was put in the system with
    the date of 12/28/2010 which should have been 1/8/2010.  Clearly a typo.  This
    error cause the contribution which was received in January and should have appeared
    in our April Quarterly report to be omitted.  Rather than wait until the end of
    the year when this contribution would have shown up I thought It would be better
    to amend the April, July and October quarterly to reflect the change.  Also in
    the October quarterly we received 3 PAC contributions (with an October 1st postmark)
    and since I am amending the reports these three contributions will also be reflected.
